import React from "react";
import style from 'styled-components';
export default function Card(props) {

   const Card = () =>{

      const container = style.div`
         display: flex;
         background-color:blue;
      `



   const{
      onClose,
      name,
      status,
      species,
      gender,
      origin,
      image
   } = props 

   return Card(
      <container>
         <button onClick={onClose}>X</button>
         <h2>{name}</h2>
         <h2>{status}</h2>
         <h2>{species}</h2>
         <h2>{gender}</h2>
         <h2>{origin}</h2>
         <img src={image} alt={name} />
      </container>
   );
   }
}
